import React from "react";

class WeatherCard extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            temperature : null,
            cloudCover : null,
            humidity : null,
            precipitation : null,
            uvIndex : null,
            visibility : null,
            weatherCode: null,
            weatherDescription: null,
            realCity: "Nowhere"
        }
        this.updateCard = this.updateCard.bind(this);
    }

    updateCard(currData) {
        this.setState({
            temperature : currData[0]["temp_F"],
            cloudCover : currData[0]["cloudcover"],
            humidity : currData[0]["humidity"],
            precipitation : currData[0]["precipInches"],
            uvIndex : currData[0]["uvIndex"],
            visibility : currData[0]["visibilityMiles"],
            weatherCode: currData[0]["weatherCode"]
        });
    }

    render() {
        return (
            <div className="WeatherCard">
                <h3>{this.state.realCity}</h3>
                <h5>Temp: {this.state.temperature}</h5>
                <h5>Cloud Cover: {this.state.cloudCover}</h5>
                <h5>Humidity: {this.state.humidity}</h5>
                <h5>Precipitation: {this.state.precipitation}</h5>
                <h5>UV Index: {this.state.uvIndex}</h5>
                <h5>Visibility: {this.state.visibility}</h5>
                <h5>Weather Code: {this.state.weatherCode}</h5>
            </div>
        );
    }
}

export default WeatherCard;
